import Menuclient from "./menu/menu";
import Salonssearch from "./saloncontainer/saloncontainer";
import Saloninvits from "./salonssection/hairsalon";
import Login from "../login/loginclient";
import Footer from "../footer/footer";
import Signupclient from "../signup/signupclient";
import Signupprof from "../signup/signupprof";

import "../../css/indexgeuss.css";

export class Index extends Component {
  render() {
    return (
      <Router>
        <Menuclient />

        <Footer />
      </Router>
    );
  }
}

const mapStateToProps = (state) => ({});

const mapDispatchToProps = {};

export default connect(mapStateToProps, mapDispatchToProps)(Index);

